Lantas kalo bukan channel Katros, kenapa ada nama Katros di belakang nama Atenx?\nBuat kalian yang lahir di bawah tahun 90an, pasti tau kalo Ateng itu nama seorang komedian terkenal. Posturnya pendek dan gemuk. Nah supaya gak salah maksud, saat itu gue mikir nambahin Katros di belakang nama Atenx hanya untuk sekdar jadi pembeda antara Ateng sang komedian dan Atenx yang punya Katros.\n.\nSingkat cerita, gue pengen bikin channel ini lebih berkembang. Tapi tetep dalam lingkup ngomongin Modifikasi atau custom motor, sesekali mobil yang gue suka atau kendaraan lain yang menurut gue unik. Bahkan ngereview tempat cuci steam yang oke, atau ngebahas motor custom buat kaum difabel. See...., masih banyak hal hal lain di dunia  otomotif yang menarik, gak cuma Katros. Motor custom hasil Katros tetep gue bahas tapi dengan porsi yang pas, pun begitu dengan unit usaha gue yang lain seperti custom.kit\n.\nNah pertanyaannya, sebelum gue mulai new season ini, temen temen ada yang mau ngasih saran kira kira konten apa yang seru dibuat video mingguan selain ngebahas modifikasi/custom motor? Silahkan tulis di kolom komen ya guys...\n\n\nTrims\nAtenx Katrosï»¿"}]},"expandButton":{"buttonRenderer":{"style":"STYLE_TEXT","size":"SIZE_DEFAULT","text":{"runs":[{"text":"Baca selengkapnya"}]},"accessibility":{"label":"Baca selengkapnya"},"trackingParams":"CLkCEK_YAiITCI--zbaElOMCFZOBrAIdvogFnCiOHg=="}},"collapseButton":{"buttonRenderer":{"style":"STYLE_TEXT","size":"SIZE_DEFAULT","text":{"runs":[{"text":"Lebih sedikit"}]},"accessibility":{"label":"Lebih sedikit"},"trackingParams":"CLgCELDYAiITCI--zbaElOMCFZOBrAIdvogFnCiOHg=="}},"publishedTimeText":{"runs":[{"text":"10 jam yang lalu (diedit)","navigationEndpoint":{"clickTrackingParams":"CLICEMShAxgAIhMIj77NtoSU4wIVk4GsAh2-iAWcKI4e","commandMetadata":{"webCommandMetadata":{"url":"/channel/UC6s63e1OJQMAvjzmwWSM_7Q/community?lb=Ugw28Eg3zfAIXK3NY8d4AaABCQ","webPageType":"WEB_PAGE_TYPE_BROWSE"}},"browseEndpoint":{"browseId":"UC6s63e1OJQMAvjzmwWSM_7Q",
